Holly Peers (born 30 July 1987) is an English glamour model, born in Manchester, England.[citation needed] She began modelling in December 2009 for The Sun's Page Three (where she is known as Hollie Peers). She continues to model for Page Three and also regularly appears in magazines such as Nuts and Loaded.[citation needed]

She is also the front cover girl for the 2011 and 2012 Page Three calendars,[citation needed] and the 2012 hot shots calendar.[citation needed]

Peers was the highest new entry in &quot;Nuts 100 Sexiest Babes 2010&quot; at No. 6.[2] She is a fan of Manchester City and appears in the team's T-shirt as a soccerette on Soccer AM.
